(()=>{"use strict";document.addEventListener("DOMContentLoaded",()=>{if(Joomla.getOptions("js-override-check")){const e=Joomla.getOptions("js-override-check");Joomla.request({url:e.ajaxUrl,method:"GET",data:"",perform:!0,onSuccess:e=>{const n=document.getElementById("plg_quickicon_overridecheck"),o=n.querySelectorAll("span.j-links-link"),t=JSON.parse(e);if(t instanceof Array)if(0===t.length){n.classList.add("success");for(let e=0,n=o.length;e<n;e+=1)o[e].innerHTML=Joomla.JText._("PLG_QUICKICON_OVERRIDECHECK_UPTODATE")}else{window.scrollTo(0,0),n.classList.add("danger");for(let e=0,n=o.length;e<n;e+=1)o[e].innerHTML=Joomla.JText._("PLG_QUICKICON_OVERRIDECHECK_OVERRIDEFOUND").replace("%s",`<span class="badge badge-light">${t.length}</span>`)}else{n.classList.add("danger");for(let e=0,n=o.length;e<n;e+=1)o[e].innerHTML=Joomla.JText._("PLG_QUICKICON_OVERRIDECHECK_ERROR")}},onError:()=>{const e=document.getElementById("plg_quickicon_overridecheck"),n=e.querySelectorAll("span.j-links-link");e.classList.add("danger");for(let e=0,o=n.length;e<o;e+=1)n[e].innerHTML=Joomla.JText._("PLG_QUICKICON_OVERRIDECHECK_ERROR")}})}})})();